import React, {Component} from 'react';
import { Container } from 'react-bootstrap';

class Cart extends Component {
    render(){
        return(
            <Container className="mt-5" style={{minHeight: '650px'}}>
                <h3>Cart</h3>
            </Container>
        )
    }
}

export default Cart;
